import React from 'react';
import { makeStyles, Theme } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import back from '../../images/back.svg';

interface TabPanelProps {
  children?: React.ReactNode;
  index: any;
  value: any;
}

function TabPanel(props: TabPanelProps) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

function a11yProps(index: any) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}

const useStyles = makeStyles((theme: Theme) => ({
  root: {
    flexGrow: 1,
  },
  bar:{
      backgroundColor:"white",
      color:"black",
  },
  bar_main:{
      backgroundColor:"white",
  }
}));

export default function SimpleTabs() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event: React.ChangeEvent<{}>, newValue: number) => {
    setValue(newValue);
  };

  return (
      <>
      <div className="container-fluid mx-auto" className={classes.bar_main}>
      <div className="row d-flex align-items-center ">
     
      <div className="col-md-10 col-11 mx-auto">
    <div className={classes.root}>
   
      <AppBar position="static" className={classes.bar}>
        <Tabs value={value} onChange={handleChange} aria-label="simple tabs example">
        <img className="img-fluid" src={back} width="30" height="30"/>
          <Tab label="Art & Craft" {...a11yProps(0)} />
          <Tab label="Architectural Design" {...a11yProps(1)} />
          <Tab label="Graphic Design" {...a11yProps(2)} />
          <Tab label="Portraits" {...a11yProps(3)} />
        </Tabs>
      </AppBar>
      </div>
    </div>
    </div>
    </div>
    <TabPanel value={value} index={0}>
      </TabPanel>
      <TabPanel value={value} index={1}>
        Item Two
      </TabPanel>
      <TabPanel value={value} index={2}>
        Item Three
      </TabPanel>
      <TabPanel value={value} index={3}>
        Item Three
      </TabPanel>
      </>
  );
}
